import Login from './Login';
import background from './background.jpg';

const LoginPage = () => {
  const Login = () => {
    alert('Please log in to access this page!');
    // Add any other logic you need, such as redirecting to the login page
  }
  };

function Bachg(){
    return(
        <div className="bg">
        <img src={background} className="pic" alt="logo" />
        <div className="container">
          <h1>Welcome to the Food Ordering ChatBot</h1>
          <b>How can we help you with your order?</b>
          <center><button onClick={Login}>Login</button></center>
        </div>
      </div>
    )
}

export default Bachg;
